import axios from "axios";
import config from './config.json'
import React from 'react'

const Recycle_bin = () => {
  async function clearAPI() {
    try {
      await clearPlayers();
      await clearGames();
      console.log("API cleared successfully.");
    } catch (error) {
      console.error("Error clearing API:", error);
    }
  }

  async function clearPlayers() {
    try {
      const response = await axios.get(config.preUrl + 'players/');
      const players = response.data.players;
      for (let i = 0; i < players.length; i++) {
        await axios.delete(config.preUrl + 'players/' + players[i].id);
      }
      console.log("Players cleared successfully.");
    } catch (error) {
      console.error("Error clearing players:", error);
    }
  }

  async function clearGames() {
    try {
      const response = await axios.get(config.preUrl + 'games/');
      const games = response.data.games;
      for (let i = 0; i < games.length; i++) {
        await axios.delete(config.preUrl + 'games/' + games[i].id);
      }
      console.log("Games cleared successfully.");
    } catch (error) {
      console.error("Error clearing games:", error);
    }
  }

  return (
    <div>
      <button onClick={clearAPI}>Clear API</button>
    </div>
  );
}

export default Recycle_bin;
